'use strict';

let isDragging = false;
let dragOffset = new Vec3(0, 0);
let direction = new Vec3(0, 0);
let bouncing = false;

let accelerationMultiplier = 0.95; //The less this parameter is, the more rapidly this layer slows down. Things will be odd if this parameter is greater than 1.
let speedCorrectionCoefficient = 0.5; //The layer will be too fast if dragged to the edge, this parameter helps the layer slow down a bit. Unreasonable speed at edges will be multiplied by this number first.

/**
 * @param {CursorEvent} event
 */
export function cursorDown(event) {
	isDragging = true;
	bouncing = false;
	dragOffset = thisLayer.origin.subtract(event.worldPosition);
}

/**
 * @param {CursorEvent} event
 */
export function cursorUp(event) {
	isDragging = false;
	bouncing = true;
}

/**
 * @param {CursorEvent} event
 */
export function cursorMove(event) {
	if (isDragging) {
		let scale = thisLayer.scale;
		let imageSize = thisLayer.size;
		let canvasSize = engine.canvasSize;

		imageSize.x *= scale.x * 0.5;
		imageSize.y *= scale.y * 0.5;

		var newOrigin = event.worldPosition.add(dragOffset);
		direction = newOrigin.subtract(thisLayer.origin);

		if (newOrigin.x < imageSize.x) {
			newOrigin.x = imageSize.x;
			direction.multiply(speedCorrectionCoefficient);
		} else if (newOrigin.x > canvasSize.x - imageSize.x) {
			newOrigin.x = canvasSize.x - imageSize.x;
			direction.multiply(speedCorrectionCoefficient);
		}

		if (newOrigin.y < imageSize.y) {
			newOrigin.y = imageSize.y;
			direction.multiply(speedCorrectionCoefficient);
		} else if (newOrigin.y > canvasSize.y - imageSize.y) {
			newOrigin.y = canvasSize.y - imageSize.y;
			direction.multiply(speedCorrectionCoefficient);
		}

		thisLayer.origin = newOrigin;
	}
}

/**
 * @param {Vec3} value
 */
export function update(value) {

	if (bouncing) {
		let scale = thisLayer.scale;
		let imageSize = thisLayer.size;
		let canvasSize = engine.canvasSize;

		imageSize.x *= scale.x * 0.5;
		imageSize.y *= scale.y * 0.5;

		value = value.add(direction);

		if (value.x < imageSize.x) {
			value.x = imageSize.x;
			direction = direction.reflect(new Vec3(1, 0));
		} else if (value.x > canvasSize.x - imageSize.x) {
			value.x = canvasSize.x - imageSize.x;
			direction = direction.reflect(new Vec3(-1, 0));
		}

		if (value.y < imageSize.y) {
			value.y = imageSize.y;
			direction = direction.reflect(new Vec3(0, 1));
		} else if (value.y > canvasSize.y - imageSize.y) {
			value.y = canvasSize.y - imageSize.y;
			direction = direction.reflect(new Vec3(0, -1));
		}
		direction = direction.multiply(accelerationMultiplier);
		if (Math.abs(direction.x) < 0.001 && Math.abs(direction.y) < 0.001) {
			direction = new Vec3(0, 0);
		}
	}

	return value;
}

