'use strict';
// Please note: Do not remove this line or asset references may break.
export let __workshopId = '2983913047';
// Please note: Do not remove this line or asset references may break.

export var scriptProperties = createScriptProperties()
	.addCheckbox({
		name: 'use12hFormat',
		label: 'Use 12 hour',
		value: false
	})
	// This will be used to separate each element
	.addText({
		name: 'delimiter',
		label: 'Delimiter',
		value: ':'
	})
	.addCheckbox({
		name: 'showTime',
		label: 'Do not display time',
		value: false
	})
	.addCheckbox({
		name: 'showCD',
		label: 'Hide date and time',
		value: false
	})
	.finish();
/**
 * @param {String} value (for property 'text')
 */
export function update(value) {
	let time = new Date();
	var hours = time.getHours();
	if (scriptProperties.use12hFormat) {
		hours %= 12;
		if (hours == 0) {
			hours = 12;
		}
	}
	hours = ("00" + hours).slice(-2);
	let minutes = ("00" + time.getMinutes()).slice(-2);
	value = hours + scriptProperties.delimiter + minutes;
	if (scriptProperties.showTime) {
		value = '\0';
	}
	if (scriptProperties.showCD) {
		value = '\0';
	}
	return value;
}

'use strict';
// Please note: Do not remove this line or asset references may break.
export let __workshopId = '3332729191';


export var scriptProperties = createScriptProperties()
    .addCheckbox({
        name: 'numericMonth',
        label: 'display month as numeric',
      value: false
    })
    .addCheckbox({
        name: 'monthFormat',
        label: 'Abbreviated Month Format',
      value: false
    })
    .addCheckbox({
        name: 'dayFormat',
        label: 'Abbreviated Day Format',
        value: false
    })
    .addCheckbox({
        name: 'showDay',
        label: 'Show Day',
        value: false
    })
   .addCheckbox({
        name: 'alignVertical',
        label: 'Align Day Vertically',
        value: false
    })
  .addCheckbox({
        name: 'useDelimiter',
        label: 'Use Delimiter',
        value: false
    })
  .addCheckbox({
    name: 'dateFormat',
        label: 'DD/MM format',
      value: false
  })
  .addCheckbox({
        name: 'twoDigitDateDay',
        label: 'Display date day number with two digit (sample: 07)',
      value: false
    })
    .addText({
        name: 'addDelimiter',
        label: 'Delimiter',
        value: '/'
    })
    .finish();


let months;
let day;
var delimiterValue;
var newLine;
/**
 * @param {String} value (for property 'text')
 */
export function update(value){
  if (scriptProperties.useDelimiter == true){
    delimiterValue = scriptProperties.addDelimiter
  }
  if (scriptProperties.useDelimiter == false){
    delimiterValue = [
    ' '
  ]
  }
  if (scriptProperties.alignVertical == true){
    newLine = [
    '\n'
  ]
  }
  if (scriptProperties.alignVertical == false){
    newLine = [
    ''
  ]
  }
  if (scriptProperties.numericMonth == true){
    months = [
    '01',
    '02',
    '03',
    '04',
    '05',
    '06',
    '07',
    '08',
    '09',
    '10',
    '11',
    '12'
  ]
  }
  else if (scriptProperties.monthFormat == true){
  months = [
    'Jan',
    'Feb',
    'Mar',
    'Apr',
    'May',
    'Jun',
    'Jul',
    'Aug',
    'Sep',
    'Oct',
    'Nov',
    'Dec'
  ]
  }
  else if (scriptProperties.monthFormat == false){
  months = [
    'January',
    'February',
    'March',
    'April',
    'May',
    'June',
    'July',
    'August',
    'September',
    'October',
    'November',
    'December'
  ]
  }
  if (scriptProperties.dayFormat == true){
    day = [
    'Sun',
    'Mon',
    'Tue',
    'Wed',
    'Thu',
    'Fri',
    'Sat'
  ]
  }
  else if (scriptProperties.dayFormat == false){
  day = [
    'Sunday',
    'Monday',
    'Tuesday',
    'Wednesday',
    'Thursday',
    'Friday',
    'Saturday'
  ]
  }
    let date = new Date();{
      var dateDisplay=date.getDate();
      if (date.getDate()<10 && scriptProperties.twoDigitDateDay){//value==true> script goes
        dateDisplay="0"+date.getDate();
      }
      if (scriptProperties.showDay){//if true, then script goes
        if(scriptProperties.dateFormat==false){
          return day[date.getDay()] + newLine + ', ' + months[date.getMonth()] + delimiterValue + dateDisplay;
        }
        else{//hits else if upper condition is not applied
          return day[date.getDay()] + newLine + ', ' + dateDisplay + delimiterValue + months[date.getMonth()];
        }
      }
      else if (scriptProperties.showDay==false){//else from showday
        if(scriptProperties.dateFormat==false){
          return months[date.getMonth()] + delimiterValue + dateDisplay;
        }
        else{//hits else if upper condition is not applied
          return dateDisplay + delimiterValue + months[date.getMonth()];
        }
      }
    }
  }

